import React, { Component } from 'react'
import videos from '../videos.json'
import Videolist from './Videolist/Videolist'
import Player from './Player/Player'

class App extends Component {

state = {
    isVideoSelected: null
}

 selectedVideo = link => {
    this.setState({
        isVideoSelected: link
    })
 }

  render() {
    return(
    <div>
        <Videolist videos={videos} onSelectedVideo={this.selectedVideo}/>
        <Player ulr={this.state.isVideoSelected}/>
    </div>)
  }
}

export default App
